import React from 'react';
import classes from './Meal.module.css';

const DUMMY_MEALS = [
    {
        id: 'm1',
        name: 'Sushi',
        description: 'Finest fish and veggies',
        price: 22.99,
    },
    {
        id: 'm2',
        name: 'Schnitzel',
        description: 'A german specialty!',
        price: 16.5,
    },
    {
        id: 'm3',
        name: 'Barbecue Burger',
        description: 'American, raw, meaty',
        price: 12.99,
    },
    {
        id: 'm4',
        name: 'Green Bowl',
        description: 'Healthy...and green...',
        price: 18.99,
    },
];



const Meal = () => {

    const mealList =
        <section className={classes.meals}>
            <ul>
                {DUMMY_MEALS.map(e => {
                    <li>
                        <div>
                            <h3>{e.name}</h3>
                        </div>
                    </li>
                })}
            </ul>
        </section>;

    return (
        <React.Fragment>
            {mealList}
        </React.Fragment>
    );
};

export default Meal;
